{"version":3,"sources":["../../src/lib/is-internal-component.ts"],"sourcesContent":["export function isInternalComponent(pathname: string): boolean {
  switch (pathname) {
    case 'next/dist/pages/_app':
    case 'next/dist/pages/_document':
      return true
    default:
      return false
  }
}

export function isNonRoutePagesPage(pathname: string): boolean {
  return pathname === '/_app' || pathname === '/_document'
}
